INSERT INTO `t_day_comments` VALUES (1,1644943,'資治通鑑：七月，丙寅，始皇崩於沙丘平臺。'),(2,1663143,'資治通鑑：夏，四月，丙寅晦，日有食之。'),(3,1723289,'前漢書：十二月丙午帝崩于未央宫。'),(4,1724360,'王莽改用丑正'),(5,1729735,'王莽亡，以寅為正'),(6,1759547,'後漢書：夏四月庚午，大赦天下，改元元興。'),(7,1781738,'三國史記卷第二新羅本紀第二阿達羅尼師今：春正月辛亥朔　日有食之。經查該月為辛卯朔。'),(8,1790445,'後漢書：十二月戊戍……詔除光熹、昭寜、永漢三號，還復中平六年。'),(9,1794584,'三國史記卷第二新羅本紀第二奈解尼師今：六年　三月丁卯朔　日有食之。查該月為丁酉朔。'),(10,1808227,'資治通鑑：九月吳改元赤烏。'),(11,1814899,'三國史記卷第二新羅本紀第二沾解尼師今：十年　冬十月晦　日有食之。未註干支。'),(12,1833240,'晉書：永嘉元年春正月癸丑朔，大赦改元。'),(13,1847121,'晉書：永和元年，春正月甲戌朔，皇太后設白紗帷於太極殿，抱帝臨軒，改元。'),(14,1853722,'晉書：興甯元年春二月己亥，大赦，改元。'),(15,1864997,'資治通鑑：庚子，萇卒。興秘不發喪。'),(16,1886221,'魏書：三月甲寅，帝崩於永安宮。'),(17,1901739,'南齊書：二十二日壬辰，使蕭諶……帝竟無一言．出西弄，殺之，時年二十二。輿尸出徐龍駒宅，殯葬以王禮。'),(18,1923927,'南史：七月……丙午，即偽位，年號天成。'),(19,1925453,'陳書：六月……景午，崩於璿璣殿。'),(20,1931862,'北齊書：乙亥，渡河入濟州。其日，幼主禪位於大丞相。'),(21,1962582,'舊唐書：三月丙申朔改元。'),(22,1965157,'舊唐書以二月丙寅改元。'),(23,1970884,'舊唐書以十二月己酉改元。'),(24,1970884,'舊唐書：十二月己酉，詔改永淳二年為弘道元年。'),(25,1970911,'新唐書以正月癸未改元。'),(26,1970946,'資治通鑑以二月壬子改元。'),(27,1975384,'舊唐書以四月改元。'),(28,1978611,'新唐書以正月甲辰改元神龍。'),(29,1981288,'舊唐書/卷七 本紀第七/睿宗李旦/景雲三年 太極元年 延和元年 先天元年：五月戊寅，親祀北郊．辛未，大赦天下，改元為延和。辛未應為辛巳。'),(30,1989869,'舊唐書：十一月壬申朔，日有蝕之。'),(31,1999289,'新唐書/本紀/卷六 本紀第六/肅宗皇帝李亨/上元二年：九月壬寅，大赦，去「乾元大聖光天文武孝感」號，去「上元」號，稱元年，以十一月為歲首，月以斗所建辰為名。'),(32,1999511,'新唐書以四月乙丑改元寶應。此從通鑑。'),(33,2009271,'從新唐書。舊唐書、通鑑未載。'),(34,2012046,'舊唐書：八月辛未朔。通鑑：八月，乙未朔。'),(35,2012931,'三國史記卷第十新羅本紀第十元聖王：冬十二月二十九日 王薨'),(36,2021939,'從新唐書。舊唐書、通鑑未載。'),(37,2026428,'從新唐書。舊唐書：丙辰望，日有蝕之。通鑑未載。'),(38,2028268,'此從新唐書/本紀/卷八 本紀第八/武宗皇帝李炎/會昌以前'),(39,2028268,'舊唐書以正月壬寅朔，庚戌改元。'),(40,2030455,'此從舊唐書/本紀/卷十八下 本紀第十八下/宣宗李忱/大中元年 。'),(41,2030461,'舊唐書以正月戊申改元。'),(42,2035057,'新唐書以八月癸巳崩。'),(43,2035524,'此從新唐書/本紀/卷九 本紀第九/懿宗皇帝李漼/咸通元年'),(44,2035524,'舊唐書以十一月丁未改元。'),(45,2040637,'冬至（至資治通鑑/卷252：日南至）'),(46,2045497,'舊唐書以二月戊子改元。'),(47,2046913,'此從新唐書/本紀/卷十 本紀第十/昭宗皇帝李曄/景福元年'),(48,2050281,'從舊唐書。新唐書：丙子改元。通鑑：丁丑改元。'),(49,2050281,'此從舊唐書/本紀/卷二十上 本紀第二十上/昭宗李曄/天復元年'),(50,2052495,'新五代史、通鑑：甲子即位，戊辰改元。'),(51,2096121,'宋史、續資治通鑑：十月甲戌朔，日有食之。'),(52,2098358,'宋史夏國上：宋改元明道，元昊避父諱，稱顯道於國中。'),(53,2104241,'宋史：皇祐元年春正月甲戌朔，日有食之。'),(54,2135633,'金史：十三年正月丙午朔，日有食之。'),(55,2197500,'元史：五月癸丑朔，日有食之。'),(56,2323152,'清史稿：（世祖本紀）五月己丑朔，日有食之。（天文十二）五年五月乙丑朔卯時，日食九分強。'),(57,2338566,'清史稿：（聖祖本紀）八月乙未朔，日有食之。（天文十二）二十九年八月己未朔卯時，日食二分太。');
